import React from "react";
import styled from "styled-components";
import { Icon } from "../icon/Icon";

export const SocialIcons = () => {
  return (
    <SocialIconLinks>
      <SocialIconLink>
        <StyledLink href="#">
          <Icon iconId="gitHub" />
        </StyledLink>
      </SocialIconLink>
      <SocialIconLink>
        <StyledLink href="#">
          <Icon iconId="linkedin" />
        </StyledLink>
      </SocialIconLink>
      <SocialIconLink>
        <StyledLink href="#">
          <Icon iconId="telegram" />
        </StyledLink>
      </SocialIconLink>
      <SocialIconLink>
        <StyledLink href="#">
          <Icon iconId="instagram" />
        </StyledLink>
      </SocialIconLink>
    </SocialIconLinks>
  );
};

const SocialIconLinks = styled.ul``;

const SocialIconLink = styled.li``;

const StyledLink = styled.a``;
